class ProductModel {

    public login: {
        username: string
    };
    public name: {
        first: string,
        last: string
    };
    public gender: string;
    public email: string;
    public dob: {
        age: number
    }
    public picture: {
        thumbnail: string,
        large: string
    }
}

export default ProductModel;
